#include <gtest/gtest.h>
#include <iostream>
#include <vector>
#include <string>
#include <algorithm>
#include "calc.hpp"

TEST(CalculatorEvalTest, singleNumber) {
  std::string input {"3"};
  EXPECT_EQ(Calc::eval(input), 3);
}

TEST(CalculatorEvalTest, addTwoNumbers) {
  std::string input {"3 +5"};
  EXPECT_EQ(Calc::eval(input), 8);
}

TEST(CalculatorEvalTest, addTwoBiggerNumbers) {
  std::string input {"123+ 576"};
  EXPECT_EQ(Calc::eval(input), 699);
}

TEST(CalculatorEvalTest, subtractTwoNumbers) {
  std::string input {"5 - 8"};
  EXPECT_EQ(Calc::eval(input), -3);
}

TEST(CalculatorEvalTest, subtractTwoBiggerNumbers) {
  std::string input {"5000 - 8"};
  EXPECT_EQ(Calc::eval(input), 4992);
}

TEST(CalculatorEvalTest, divideTwoNumbers) {
  std::string input {"8/3"};
  EXPECT_EQ(Calc::eval(input), 2);
}

TEST(CalculatorEvalTest, divideTwoBiggerNumbers) {
  std::string input {"1000/103"};
  EXPECT_EQ(Calc::eval(input), 9);
}

TEST(CalculatorEvalTest, multiplyTwoNumbers) {
  std::string input {"12 * 13"};
  EXPECT_EQ(Calc::eval(input), 156);
}

TEST(CalculatorEvalTest, multiplyTwoBiggerNumbers) {
  std::string input {"120 * 136"};
  EXPECT_EQ(Calc::eval(input), 16320);
}

TEST(CalculatorEvalTest, divideByZero) {
  std::string input {"(3+5) / ((8-3) * 0)"};
  EXPECT_THROW(Calc::eval(input), std::runtime_error);
}

TEST(CalculatorEvalTest, divideByZeroAgain) {
  std::string input {"(3+5) / (8 / 3 -2 )"};
  EXPECT_THROW(Calc::eval(input), std::runtime_error);
}

TEST(CalculatorEvalTest, MixedOperationsWithPrecedence) {
    EXPECT_EQ(Calc::eval("3+5*2"), 13);       // 5*2=10 → 3+10=13
    EXPECT_EQ(Calc::eval("3*5/2+3"), 10);     // 3*5=15 → 15/2=7 → 7+3=10 (integer division)
    EXPECT_EQ(Calc::eval("10-6/2"), 7);       // 6/2=3 → 10-3=7
}

TEST(CalculatorEvalTest, HandlesSpacesInExpression) {
    EXPECT_EQ(Calc::eval("  4 +  5 * 2 "), 14);
}

TEST(CalculatorEvalTest, ParenthesesOverridePrecedence) {
    EXPECT_EQ(Calc::eval("(2+3)*4"), 20);     // 2+3=5 → 5*4=20
    EXPECT_EQ(Calc::eval("2*(3+4)"), 14);     // 3+4=7 → 2*7=14
    EXPECT_EQ(Calc::eval("10/(2+3)"), 2);     // 2+3=5 → 10/5=2
    EXPECT_EQ(Calc::eval("4*(2+3)/5"), 4);    // (2+3)=5 → 4*5=20 → 20/5=4
}

TEST(CalculatorEvalTest, ParenthesesAndPrecedence) {
  EXPECT_EQ(Calc::eval("5*(6+3)/2"), 22);     // 6+3 = 9 → 5*9 = 45 → 45/2 = 22
}

TEST(CalculatorEvalTest, NestedParentheses) {
    EXPECT_EQ(Calc::eval("2*(1+(2+3))"), 12);       // inner: 2+3=5 → outer: 1+5=6 → 2*6=12
    EXPECT_EQ(Calc::eval("((2+3)*2)+1"), 11);       // (2+3)=5 → 5*2=10 → +1=11
    EXPECT_EQ(Calc::eval("(((((3)))))"), 3);        // redundant nesting
}

TEST(CalculatorEvalTest, ParenthesesWithSpaces) {
    EXPECT_EQ(Calc::eval(" ( 3 + 4 ) * 2 "), 14);
    EXPECT_EQ(Calc::eval(" ( 8 - 3 ) * (2 + 1) "), 15);
}

TEST(CalculatorEvalTest, compoundExpression) {
  std::string input {"3 * 4 + (2-1)"};
  EXPECT_EQ(Calc::eval(input), 13);
}

TEST(CalculatorEvalTest, leftAssociative) {
  std::string input {"10/2/2"};
  EXPECT_EQ(Calc::eval(input), 2);
}

TEST(CalculatorEvalTest, sameExampleWithParens) {
  std::string input {"10/(2/2)"};
  EXPECT_EQ(Calc::eval(input), 10);
}

TEST(CalculatorEvalTest, biggerFormula) {
  std::string input {"(9 - 4)* (3 - 2 + 7 - 2 *3)"};
  EXPECT_EQ(Calc::eval(input), 10);
}

TEST(CalculatorEvalTest, gauss) {
  std::string input {};
  for (int i = 1; i < 100; ++i) {
    input.append(std::to_string(i));
    input.push_back('+');
  }
  input.append("100");
  EXPECT_EQ(Calc::eval(input), 5050);
}

TEST(CalculatorEvalTest, multiplyByOne) {
  std::string input {};
  for (int i = 0; i < 10'000; ++i) {
    input.append("1*");
  }
  input.push_back('1');
  EXPECT_EQ(Calc::eval(input), 1);
}

TEST(CalculatorEvalTest, productOneThroughTen) {
  std::string input {};
  for (int i = 1; i < 10; ++i) {
    input.append(std::to_string(i));
    input.push_back('*');
  }
  input.append("10");
  EXPECT_EQ(Calc::eval(input), 3'628'800);
}

TEST(CalculatorEvalTest, largerGauss) {
  std::string input {};
  for (int i = 1; i < 1000; ++i) {
    input.append(std::to_string(i));
    input.push_back('+');
  }
  input.append("1000");
  EXPECT_EQ(Calc::eval(input), 500'500);
}

TEST(CalculatorEvalTest, largerNumberFormula) {
  std::string input {"8723*3278+2387-2370/10"};
  EXPECT_EQ(Calc::eval(input), 28'596'144);
}

TEST(CalculatorEvalTest, largerNumberFormula2) {
  std::string input {"2389*23987-2398+(2389*2389-28)*3"};
  EXPECT_EQ(Calc::eval(input), 74'424'424);
}

